- input: "TEXT\x1CC00432260\x1C.TEXT\x1C\x1CF3XA\x1CWe are in receipt of your 2/22/08
    ltr referring to the 12-Day Pre-Primary-Report (7/1-10/17/07). We have addressed
    through an amended report the various issues raised. In reverse order the issues
    were as follows: Item #4: We have amended any transactions on Sched. E that were
    missing info. In previous versions of the software, this info was linked to the
    candidate, but, in this version, became de-linked and had to be added manually.
    Item #3 indicates that some items on Sched. A were not reported on Sched. B. After
    conferring with our database provider, we have re-imported the data into the FECfile
    and corrected this issue on the amended report. This issue should not recur. Item
    #2: Because of a data entry error, packages of earmarked contributions sent to
    candidates on 7/12/07 were inadvertently reported as being transmitted on 7/11/07.
    The date of the transmittal has been corrected in the amendment. Item #1: The
    PAC is aware of the 10-day transmittal period for earmarked contributions and
    always strives for 100% compliance. Nonetheless, because of a technical problem
    with the communication between our website and database and, seperately, a staffing
    shortage, a few brief delays did occur, reducing compliance for this period to
    98%. All dates reported were correct.These issues have been resolved and should
    not pose any problems in the future."
